insert into book (id, title, author, copies, copies_available, description, img) values (10000001, 'The end of Eternity', 'Isaac Asimov', 10, 10, 'Andrew Harlan’s job is to range through past and present centuries monitoring and even altering Time’s myriad cause-and-effect relationships. As a Technician with the Allwhen Council, he initiates Reality Changes that may affect the lives of as many as fifty billion people – and a million or more of them may be so drastically affected as to be considered new individuals. Above all, therefore, a Technician must be dispassionate. An emotional make-up is a distinct handicap. Then Harlan meets Noys and falls victim to a phenomenon older than Time itself – love. Years of self-discipline are cast aside as Harlan uses the awesome techniques of the Eternals to twist Time so that he and Noys might survive together.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000002, 'I, Robot', 'Isaac Asimov', 10, 10, 'They mustn''t harm a human being, they must obey human orders, and they must protect their own existence. But only as long as that doesn''t violate rules one and two. With these Three Laws of Robotics, humanity embarked on perhaps its greatest adventure: the invention of the first positronic man. It was a bold new era of evolution that would open up enormous possibilities – and unforeseen risks. As humans and robots struggle to survive together – and sometimes against each other – on earth and in space, the future of both hangs in the balance. Humans confront robots gone mad, telepathic robots, robot politicians, and vast robotic intelligences that may already secretly control the world. And both are asking the same questions: What is human? And is humanity obsolete? ', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000003, 'The rest of the robots', 'Isaac Asimov', 10, 10, 'How could robots be used in a time of war? Could a robot be raised like a child? Could we allow them to have children of their own? Is there any human profession that could never be performed by a robotic replacement? In The Rest of the Robots, robopsychologist Dr. Susan Calvin and engineers Powell and Donovan return to investigate many more puzzling anomalies and catastrophic malfunctions. With characteristic wit, foresight and imagination, Asimov’s stories uncover the practical and ethical issues humanity will encounter in a robotic future.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000004, 'The positronic man', 'Isaac Asimov', 10, 10, 'In the twenty-first century the creation of the positronic brain leads to the development of robot laborers and revolutionizes life on Earth. But to the Martin family, their household robot NDR-113 is more than a trusted friend, a confidant, a member of the family. For through some unknown manufacturing glitch, Andrew has been blessed with a capacity for love and a drive toward self-awareness and development that are almost human. But almost is not enough. Andrew''s dream is to become fully human. Facing human prejudice, the laws of robotics, and his own mechanical limitations, Andrew will use science and law in his quest for the impossible, arriving at last at a terrifying choice: to make his dream a reality, he must pay the ultimate price.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000005, 'Mother Earth', 'Isaac Asimov', 10, 10, 'Earth faces a confrontation with its colonies, the "Outer Worlds." A historian looks back and sees the problem beginning a century-and-a-half earlier, when Aurora got permission to "introduce positronic robots into their community life." No date is given, but fifty years before the story starts, the Outer Worlds established an immigration quota against incoming Terran citizens. The balance of power then tipped. Now war appears likely, and there are rumors that Earth has developed an unknown weapon.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000006, 'The caves of steel', 'Isaac Asimov', 10, 10, 'Detective Elijah Baley investigates the murder of an off-worlder in Spacetown. In the opinion of the Spacers, the murder is tied up with recent attempts to sabotage the Spacer-sponsored project of converting Earth to an integrated human/robot society on the model of the Outer Worlds. To search for the killer in the City’s vast caves of steel, Elijah is assigned a Spacer partner named R. Daneel. That’s Robot Daneel. And notwithstanding the celebrated Three Laws of Robotics, which should make such a murder impossible, R. Daneel is soon Elijah’s prime suspect.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000007, 'The naked Sun', 'Isaac Asimov', 10, 10, 'On the planet of Solaria, Spacers live in almost complete isolation, tended by robot servants and disgusted by the thought of human contact. And yet, one of their members has been beaten to death. Incapable of solving the crime, the authorities of the Outer Worlds seek help from Earth – from renowned detective Elijah Baley. Partnered once again with the robot Daneel Olivaw, Baley travels to this strange new world and uncovers a plot that could change the relationship between humans and robots forever.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000008, 'Mirror image', 'Isaac Asimov', 10, 10, 'After having received numerous requests to continue the story of detective Elijah Baley and his robot partner R. Daneel Olivaw, featured in his earlier novels The Caves of Steel and The Naked Sun, Asimov wrote this short detective story.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000009, 'The robots of dawn', 'Isaac Asimov', 10, 10, 'Detective Elijah Baley is called to the Spacer world Aurora to solve a bizarre case of roboticide. The prime suspect is a gifted roboticist who had the means, the motive, and the opportunity to commit the crime. There''s only one catch: Baley and his positronic partner, R. Daneel Olivaw, must prove the man innocent. For in a case of political intrigue and love between woman and robot gone tragically wrong, there''s more at stake than simple justice. This time Baley''s career, his life, and Earth''s right to pioneer the Galaxy lie in the delicate balance.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000010, 'Robots and Empire', 'Isaac Asimov', 10, 10, 'Two centuries have passed since Elijah Baley’s actions on Aurora sent settlers from Earth to new worlds all over the galaxy. The Spacer planet of Solaria has been abandoned by humans, though countless robots remain. When settlers arrive to salvage them, something unthinkable happens – the robots attack. Accompanied by Gladia Delmarre and the robots Daneel and Giskard, a descendant of Elijah Baley sets out for Solaria to investigate, a quest that will lead them to a vast, catastrophic conspiracy and a revolution in the Three Laws of Robotics.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000011, 'The stars, like dust', 'Isaac Asimov', 10, 10, 'Biron Farrell was young and naive, but a radiation bomb planted in his room changed him from an innocent student at the University of Earth to a marked man, fleeing desperately from an unknown assassin. He soon discovers that, many light-years away, his father, the highly respected Rancher of Widemos, has been murdered. Stunned, grief-stricken, and outraged, Biron is determined to uncover the reasons behind his father’s death, and becomes entangled in an intricate saga of rebellion, political intrigue, and espionage. The mystery takes him deep into space where he finds himself in a relentless struggle with the power-mad despots of Tyrann. Now it is not just a case of life or death for Biron, but a question of freedom for the galaxy.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000012, 'The currents of space', 'Isaac Asimov', 10, 10, 'The fate of the galaxy hangs in the balance. High above the planet Florina, the Squires of Sark live in unimaginable wealth and comfort. Down in the eternal spring of its surface, however, the native Florinians labour ceaselessly for their Sarkite masters. Rebellion is unthinkable and impossible. But now both worlds are hurtling toward a cataclysm, and only one man knows the truth; a man without a memory or a past, unaware of the secret locked inside his own brain: their world is doomed.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000013, 'Pebble in the sky', 'Isaac Asimov', 10, 10, 'One moment Joseph Schwartz is a happily retired tailor in 1949 Chicago. The next he''s a helpless stranger on Earth during the heyday of the first Galactic Empire. Earth, he soon learns, is a backwater, just a pebble in the sky, despised by all the other 200 million planets of the Empire because its people dare to claim it''s the original home of man. And Earth is poor, with great areas of radioactivity ruining much of its soil – so poor that everyone is sentenced to death at the age of sixty. Joseph Schwartz is sixty-two.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000014, 'Prelude to Foundation', 'Isaac Asimov', 10, 10, 'In a time before the Foundations, psychohistory’s creator Hari Seldon is made to stand before the Emperor of the crumbling Galactic Empire to present how his scientific theory of predicting the future might be applied to the real world. However, Hari refuses to deploy his theory for political gain, setting off instead with reporter Chetter Hummin in quest of a place to safely apply his theory: Earth, the original home of humanity. All records of Earth have been lost to time. Hari will therefore have to look back into the past, in order to seal the future of humanity forever.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000015, 'Forward the Foundation', 'Isaac Asimov', 10, 10, 'As Hari Seldon struggles to perfect his revolutionary theory of psychohistory and ensure a place for humanity among the stars, the once-mighty Galactic Empire totters on the brink of apocalyptic collapse. Caught in the maelstrom are Seldon and all he holds dear, pawns in the struggle for dominance. Whoever can control Seldon will control psychohistory – and with it the future of the galaxy. Among those seeking to turn psychohistory into the greatest weapon known to man are a populist political demagogue, the weak-willed Emperor Cleon I, and a ruthless militaristic general. In his last act of service to humankind, Hari Seldon must somehow save his life''s work from their grasp as he searches for his true heirs – a search that begins with his own granddaughter and the dream of a new Foundation.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000016, 'Foundation', 'Isaac Asimov', 10, 10, 'The Galactic Empire has prospered for twelve thousand years. Nobody suspects that the heart of the thriving Empire is rotten, until psychohistorian Hari Seldon uses his new science to foresee its terrible fate. Exiled to the desolate planet Terminus, Seldon establishes a colony of the greatest minds in the Empire, a Foundation which holds the key to changing the fate of the galaxy. However, the death throes of the Empire breed hostile new enemies, and the young Foundation’s fate will be threatened first.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000017, 'Foundation and Empire', 'Isaac Asimov', 10, 10, 'The First Foundation survived two centuries of barbarism as the once-mighty Galactic Empire descended into chaos. Now it must prepare for war against the remnants of the Empire as the Imperial fleet advances on their planet, Terminus. Hari Seldon predicted this war. He even prepared his Foundation for it. But he couldn’t foresee the birth of the mutant Mule. In possession of a power which reduces fearsome opposition to devoted slaves, the Mule poses a terrible threat to Seldon’s Foundation.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000018, 'Second Foundation', 'Isaac Asimov', 10, 10, 'The First Foundation has been defeated, crushed by the formidable mental powers of the Mule. But whispers of the mysterious Second Foundation, the only hope of defeating the Mule, are beginning to spread. Surviving members of the First Foundation also fear the secret powers of the Second Foundation, vowing to find and destroy it. However, the location of the Second Foundation remains shrouded in mystery. Finding it will lead the Foundation to the opposite end of the Galaxy, where the fate of Seldon’s two Foundations awaits.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000019, 'Foundation''s edge', 'Isaac Asimov', 10, 10, 'After a long war which saw the First Foundation emerge victorious, the Second Foundation is now believed to be extinct, and all records of planet Earth’s existence have been erased. No one suspects that the Second Foundation could still exist. None, except Council member Golan Trevize, who finds himself ordered to leave Terminus, accompanied by historian Janov Pelorat, in order to find it. Yet this quest will lead an unsuspecting Golan further than he could have possibly imagined – closer than ever to Earth, where the fate of the whole galaxy awaits him.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000020, 'Foundation and Earth', 'Isaac Asimov', 10, 10, 'Faced with determining the fate of the galaxy, Golan Trevize hesitantly chose to hand over the rule of the galaxy to planet Gaia. Two mysteries now remain: who has erased the records of Earth – and why? Determined to ensure his choice was right, Golan sets off with Janov Pelorat and Bliss, to answer these questions once and for all. But nothing could prepare them for the secrets which await them on Earth. Secrets which predate history as they know it, and will change its significance forever.', 'data:image/jpeg;base64,') on conflict do nothing;
insert into book (id, title, author, copies, copies_available, description, img) values (10000021, 'The gods themselves', 'Isaac Asimov', 10, 10, 'In the twenty-second century Earth obtains limitless, free energy from a source science little understands: an exchange between Earth and a parallel universe, using a process devised by the aliens. But even free energy has a price. The transference process itself will eventually lead to the destruction of the Earth''s Sun and of Earth itself. Only a few know the terrifying truth – an outcast Earth scientist, a rebellious alien inhabitant of a dying planet, a lunar-born human intuitionist who senses the imminent annihilation of the Sun. They know the truth, but who will listen? They have foreseen the cost of abundant energy, but who will believe? These few beings, human and alien, hold the key to the Earth''s survival.', 'data:image/jpeg;base64,') on conflict do nothing;
